import React from 'react';
import { DraggableItem } from "../components/Generals/DraggableItem";
import { ShapeType } from '../contexts/DraggableContext';

type Shape = {
  id: string;
  type: ShapeType;
};

const shapes: Shape[] = [
  { id: 'circle', type: 'circle' },
  { id: 'rectangle', type: 'rectangle' },
];

const ShapeLibrary: React.FC = () => {
  return (
    <div className="p-3">
      <h5>Shapes</h5>
      <div className="mt-3">
        {shapes.map(shape => (
          <div className="mb-2">
            <DraggableItem key={shape.id} type={shape.type} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default ShapeLibrary;
